import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Layout />}>
        <Route path="invoice" element={<Invoice />} />
        <Route path="dashboard" element={<Dashboard />} />
        <Route />
      </Route>
    </Routes>
  );
}

export default App;
